import { useContext } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import MetaContext from "../../MetaContext";
import { Logout, Login } from "../HomePage/LoginLogout";

const Navigator = () => {
    const { token, setToken } = useContext(MetaContext);

    const options = [
        { title: "Home", path: "/OSCE" },
        { title: "OSCE", path: "/OSCE" },
        { title: "Med", path: "/OSCE" },
        { title: "Home", path: "/OSCE" },
        { title: "Home", path: "/OSCE" },
    ];

    return (
        <>
            <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                <LogoTitle>
                    <Link to="/">
                        <h1>MedBakery</h1>
                    </Link>
                </LogoTitle>
                {token ? <Logout darkMode={true} setToken={setToken} /> : <Login label="Login" />}
            </div>

            <div style={{ borderBottom: "0.5px solid grey" }}>
                <div style={{ display: "flex", marginLeft: "5%" }}>
                    <Option style={{ backgroundColor: "#2f3237", color: "#FAD000" }}> Home </Option>
                    <Option style={{ backgroundColor: "#2f3237", color: "#FAD000" }}> OSCE </Option>
                    <Option style={{ textDecoration: "line-through" }}> MedBook </Option>
                    <Option style={{ textDecoration: "line-through" }}> QBank </Option>
                    <Option style={{ textDecoration: "line-through" }}> Anatomy </Option>
                </div>
            </div>
        </>
    );
};

const LogoTitle = styled.div`
    margin: 30px 5%;
`;

const Option = styled.div`
    padding: 15px;
`;

export default Navigator;
